import React, { useState } from "react";
import {
  Text,
  View,
  StyleSheet,
  Image,
  SafeAreaView,
  TouchableOpacity,
  Button,
} from "react-native";
import { TextInput, ScrollView } from "react-native";

export const SP1 = ({ route, navigation }) => {
  const [type, Settype] = useState("");
  const [ratePerHour, SetratePerHour] = useState("");
  const [workingHours, Setworking_hours] = useState("");
  const [offDays, Setoff_days] = useState("");
  const [finishingHour, SetfinishingHour] = useState("");
  const [landLine, Setland_line] = useState("");

  const [data2, setData2] = React.useState({
    isRequiredType: true,
    isRequiredRate: true,
    isRequiredWorking_hours: true,
    isRequiredOff_days: true,
    isRequiredLand_line: true,
  });
  const {
    name,
    userName,
    phoneNumber,
    email,
    password,
    passwordConfirm,
    nationalID,
    address,
    country,
    city,
    role,
    image,
  } = route.params;

  function Next() {
    navigation.navigate("SP2", {
      name: name,
      username: userName,
      phoneNumber: phoneNumber,
      email: email,
      password: password,
      passwordConfirm: passwordConfirm,
      nationalID: nationalID,
      country: country,
      city: city,
      address: address,
      role: role,
      type: type,
      workingHours: workingHours,
      finishingHour: finishingHour,
      offDays: offDays,
      ratePerHour: ratePerHour,
      landLine: landLine,
    });
  }
  return (
    <View style={styles.container1}>
      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter Type"
          onChangeText={(type) => Settype(type)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>
      {data2.isRequiredType ? null : (
        <View style={styles.error}>
          <Text style={styles.errormsg}>Reuired Input</Text>
        </View>
      )}
      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter ratePerHour"
          onChangeText={(type) => SetratePerHour(type)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>

      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter finishingHour"
          onChangeText={(type) => SetfinishingHour(type)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>

      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter Working_Hours"
          onChangeText={(working_hours) => Setworking_hours(working_hours)}
          onEndEditing={(e) => handelRequiredWorking_hours(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>

      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter Off_Days"
          onChangeText={(off_days) => Setoff_days(off_days)}
          onEndEditing={(e) => handelRequiredOff_days(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>
      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter landLine"
          onChangeText={(landLine) => Setland_line(landLine)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>

      <TouchableOpacity style={styles.buttoncontainer1} onPress={Next}>
        <Text style={styles.buttontext1}>Next</Text>
      </TouchableOpacity>
    </View>
  );
};
const styles = StyleSheet.create({
  container1: {
    backgroundColor: "rgb(245, 245, 245)",
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    paddingTop: 120,
    paddingBottom: 60,
  },
  input: {
    flexDirection: "row",
  },
  inputtext1: {
    borderRadius: 9,
    width: 250,
    height: 40,
    borderColor: "rgb(48, 71, 94)",
    borderWidth: 1,
    paddingHorizontal: 10,
    fontSize: 15,
    color: "black",
    marginVertical: 10,
  },
  errormsg: {
    bottom: 5,
    paddingRight: 199,
    color: "red",
  },
  buttoncontainer1: {
    borderRadius: 15,
    width: 150,
    height: 45,
    backgroundColor: "rgb(240, 84, 84)",
    paddingTop: 1,
    justifyContent: "center",
    marginTop: 30,
    marginBottom: 30,
    paddingLeft: 60,
  },
  buttontext1: {
    textAlign: "center",
    color: "black",
    fontSize: 15,
    right: 30,
  },
  logo: {
    height: 128,
    width: 128,
  },
});
